import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';
import ContributorList from './ContributorList'


var arrayContributors = [
    {
        "name": "Contributor 1",
        "description": "placeholder text",
        "image": "https://cdn.pixabay.com/photo/2016/08/08/09/17/avatar-1577909_960_720.png",
    },
    {
        "name": "Contributor 2",
        "description": "placeholder text",
        "image" : "https://cdn.pixabay.com/photo/2016/08/08/09/17/avatar-1577909_960_720.png",
    },
    {
        "name": "Micheal",
        "description": "godfather",
        "image" : "https://static.wikia.nocookie.net/godfather/images/a/aa/Michael_Corleone_Part_I.jpg/revision/latest?cb=20190828200514",
    },
]



function Contributers() {
    
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributers
                </p>
            </header>
            {arrayContributors.map(contributor =>
                <ContributorList {...contributor}/>
            )}
        </div>
    );
}

export default Contributers;
